@langyo 

I am not sure why you need to enable `sqlx` for proxy? I think they should compile without it anyway?

Regarding CI, sorry but our CI is already very slow right now, a cycle can take up to 30 minutes on a bad day lol. Can you set up the CI on your fork instead?

## PR Info

- Discussed on https://discord.com/channels/873880840487206962/1090939656864010312/1090939656864010312

## New Features

- [x] Implement `ColumnTypeTrait` for `ColumnDef`

## Bug Fixes

- [x] Following code is being generated by the codegen. Implement `ColumnTypeTrait` for `ColumnDef` will fix it.
```rs
impl ColumnTrait for Column {
    type EntityName = Entity;
    fn def(&self) -> ColumnDef {
        match self {
...
            // `db_type()` returns `ColumnDef` but `ColumnDef` doesn't implement `ColumnTypeTrait`
            Self::Thing => AnActiveEnumThing::db_type().def(),
...
        }
    }
}
```
